import Createexam from "./ExamMaster/Createexam";
import "./App.css";
import Header from "./Header/Header";
import Footer from "./Footer/Footer";
import { Routes, Route } from "react-router-dom";
import Login from "./ExamMaster/Login";
import NoMatch from "./NoMatch/NoMatch";
import User from './User/User'
import Topicpage from "./ExamMaster/Topicpage";
import Admin from "./ExamMaster/Admin";
import QuestionMaster from "../src/ExamMaster/QuestionMaster/QuestionMaster";
import Mainpage2 from "./ExamMaster/Mainpage2";
import CreateExamMaster from "./ExamMaster/CreateExamMaster";
import ShowExams from "./ExamMaster/ShowExams";
import ShowTopics from "./ExamMaster/ShowTopics";
import RegisterUser from "./ExamMaster/RegisterUser";
import ShowQuestions from "./ExamMaster/QuestionMaster/ShowQuestions";
import Demo1 from "./ExamMaster/Demo1";
import ExamTopicMapping from "./ExamMaster/QuestionMaster/ExamTopicMapping";
import TopicPage from "./ExamMaster/QuestionMaster/TopicPage";
import ExamTopicMappingView from "./ExamMaster/ExamTopicMappingView";
import QuestionForTopicView from "./ExamMaster/QuestionForTopicView";
import DetailsOfQuestion from "./ExamMaster/DetailsOfQuestion";


function App() {
  return (
    <div className="App">
      <Header />
        <Routes>
        <Route path="/" element={<Login />} />
        <Route path="*" element={<NoMatch />} />
        <Route path="user" element={<User/>}/>
        <Route path="admin" element={<Admin/>}>

          {/* EXAMS */}
      <Route path="createExam" element={<CreateExamMaster/>}/>
      <Route path="createExam/:examId" element={<CreateExamMaster/>}/>
       <Route path="updateExam" element={<ShowExams/>}/>

       <Route path="updateExam/examdetails/:examId/" element={<ExamTopicMappingView/>} />
       <Route path="updateExam/examdetails/:examId/:topicId" element={<ExamTopicMappingView/>} />
       <Route path="updateExam/examdetails/question-topicView/:topicId/:examId" element={<QuestionForTopicView/>}/>

        <Route path="/updateExam/examdetails/question-topicView/view-questions/:questionId/:topicName/" element={<DetailsOfQuestion/>}/>
        {/* <Route path="updateExam/examDetails/question-topicView/view-questions/:topicId/:examId" element={<QuestionForTopicView/>}/> */}

       {/* TOPIC */}
       <Route path="addTopic" element={<Topicpage/>} />
       <Route path="updateTopic" element={<ShowTopics/>}/> 


       {/* QUESTION */}
      <Route path="addQuestions" element={<QuestionMaster/>} />
       <Route path="updateQuestions" element={<ShowQuestions/>} />

        </Route>
      </Routes> 

      {/* <Createexam/>    */}
      {/* <Login/>    */}

        {/* <QuestionMaster/>     */}
      {/* <ShowQuestions/>   */}
     {/* <ExamTopicMapping/>    */}
      {/* <TopicPage/> */}
      {/* <Topicpage/>   */}
      {/* <Mainpage2/>   */}
     {/* <ShowExams/>    */}
    {/* <ExamTopicMappingView/>   */}
      {/* <CreateExamMaster/>   */}
      {/* <ShowTopics/>  */}
      {/* <RegisterUser/>  */}
      {/* <Mainpage2/> */}
      {/* <Mainpage/> */}
      {/* <Demo1/> */}
      <Footer />
    </div>
  );
}

export default App;
